INSERT INTO `histos` VALUES (1,'Nan Thu Thu Phyo','nan-thu-thu-phyo',0,0,23,'Female','Dr. ZML','Suction curettage','2022-08-07','2022-08-07','2022-08-09','Multiple pieces of tissues about 3 CC. AE','The sections of biopsy show blood admixed with sheets of chorionic villi which are dilated and composed of edematous loose myxoid stroma lined by regular to focally hyperplastic trophoblastic epithelium. Sheets of decidual cells and endometrial glands with Aristella reaction are noted. There are no features of malignancy.','Consistent with Hydatidiform mole, partial mole','0','0',1,1,2,'2022-08-09 17:17:05','2022-08-09 17:17:05'),(2,'Zar Chi Htwe','zar-chi-htwe',0,0,21,'Female','Dr.ZML','Suction currettage','2022-08-07','2022-08-07','2022-08-07','Multiple pieces of tissue 5 CC. AE','The sections of biopsy show blood admixed with sheets of chorionic villi which are dilated and composed of edematous loose myxoid stroma lined by regular to focally hyperplastic trophoblastic epithelium. Sheets of decidual cells and endometrial glands with aristella reaction are noted. There are no features of malignancy.','Hydatidiform mole, partial mole','0','0',1,1,2,'2022-08-09 17:20:12','2022-08-09 17:20:12'),(3,'U Tun Tun Aung','u-tun-tun-aung',0,0,40,'Male','Professor Dr. U Aung Moe','Pile','2022-08-08','2022-08-09','2022-08-11','Tissue measured 4.5x1.5x0.5 cm.','The histology section of tissue composed of stratified squamous epithelium and mucus secreting columnar epithelium with underlying fibromuscular tissue in which lymphoid aggregates with numerous dilated blood vessels are noted.','Hemorrhoids','0','0',1,2,2,'2022-08-11 15:18:47','2022-08-11 15:18:47'),(4,'Ko Hlaing Min Thein','ko-hlaing-min-thein',0,0,39,'Male','Professor Dr. U Aung Moe','FIA','2022-08-08','2022-08-09','2022-08-11','One piece of tissue measured 1.5x1 cm','The histology section of tissue composed of stratified squamous epithelium with underlying fibromuscular tissue in which chronic inflammatory cells infiltration are noted.','Chronic non-specific inflammatory tissue, Consistent with FIA','0','0',1,2,2,'2022-08-11 15:26:03','2022-08-11 15:26:03'),(5,'Thura Win','thura-win',0,0,24,'Male','Professor Dr. U Aung Moe','Sebaceous cyst','2022-08-08','2022-08-09','2022-08-11','One piece of tissue measured 1.5x1.5x0.5 cm.','The histology section of tissue composed of stratified squamous epithelium with underlying fibrous tissue. There is cyst lined by stratified squamous epithelium with some keratinous material.','Keratinous cyst, Right cheek','0','0',1,3,2,'2022-08-11 15:37:00','2022-08-11 15:37:00'),(6,'Daw Tha Ra','daw-tha-ra',0,0,68,'Male','Professor Dr. U Aung Moe','Recto-Sigmoid','2022-08-08','2022-08-09','2022-08-11','Tissue measured 15x7x3 cm, tumor measured 2.5x2 cm, 4 cm away from one end and 8 cm away from another end. Two polyps on cut section measured 1x1 cm. No lymph nodes.','The histology section of the tissue composed of the infiltration lesion of neoplastic malignant tumor tissue across the wall of the large intestine till pericolic tissue. There is less gland formation (<50% gland formation in tumor area). Tumor budding is high (> 10 buds). Margins are free from the lesions. The polyps showed hyperplastic polyp.','Poorly differentiated adenocarcinoma, Recto-sigmoid, pT3pNX','0','0',4,3,2,'2022-08-11 21:39:57','2022-08-11 21:39:57'),(7,'Kyaw Ko Ko Latt','kyaw-ko-ko-latt',0,0,45,'Male','Professor Dr. U Aung Moe','Rectum','2022-08-08','2022-08-09','2022-08-11','Tissue measured 20x8x3 cm, Tumor measured 4x2.5 cm, 1 cm away from one end and 11 cm from another end. Three lymph nodes present, two measured 1x1 cm each and another 3x2 cm. Anal skin not included.','The sections of tissue from tumor cells composed of the neoplastic malignant cells having marked pleomorphic vesicular to hyperchromatic nuclei, prominent nucleoli. Well-formed glands are 50 to 95 % of tumor composed of glands. These tumor cells also invade up to the muscular layers into pericolorectal tissues. The stroma is infiltrated by some chronic inflammatory cells. Tumor budding is low (0-4/20 x field). Both margins are free from the lesions. The lymph nodes showed only reactive follicular hyperplasia and sinus histiocytosis .','Moderately differentiated adenocarcinoma, Rectum (pT3pN0)','0','0',5,3,2,'2022-08-11 21:58:54','2022-08-11 21:58:54'),(8,'Daw Myint Thein','daw-myint-thein',0,0,67,'Female','Dr.','Neck gland','2022-08-08','2022-08-09','2022-08-11','Two pieces of tissues each measured 2.5x2 and 1.5x1 cm.','The histology section of tissue composed of fibrofatty tissue in which there are numerous granuloma formation. There are extensive area of necrosis with langerhans types of giant cells. Epitheloid cells are also noted.','Chronic granulomatous lymphadenitis consistent with tuberculous lymph adenitis, Neck glands, site and side not mention','0','0',7,5,2,'2022-08-11 22:09:00','2022-08-11 22:09:00'),(9,'Ma Yin Yin Htay','ma-yin-yin-htay',0,0,50,'Female','Dr.','FIA','2022-08-08','2022-08-09','2022-08-11','One piece of tissue measured 2x1 cm.','The histology section of tissue composed of fibro-muscular tissue with mature adipose tissue. Mild chronic inflammatory cells are noted.','Consistent with FIA','0','0',6,5,2,'2022-08-11 22:17:22','2022-08-11 22:17:22'),(10,'Ma Win Mar','ma-win-mar',0,0,31,'Female','Dr.','Vulva warts','2022-08-08','2022-08-09','2022-08-11','Two pieces of tissues each measured 1x0.5 and 0.5x0.5 cm. AE','The histology section of tissue composed of stratified squamous epithelium with inverted lobules of hyperplastic squamous epithelium which expand into the underlying dermis. There are Henderson-Paterson or molluscum bodies (intracytoplasmic eosinophilic inclusion bodies). At the granular layer, the bodies become increasingly hematoxyphilic and occupy the entire cell. Chronic inflammatory infiltrations are also noted. Margins are free from the lesions.','Molluscum contagiosum, Vulva','0','0',6,6,2,'2022-08-11 22:40:10','2022-08-11 22:40:10'),(14,'Ma Myaing','ma-myaing',0,0,27,'Female','Dr. Khin Ei Khaing (Senior Consultant ENT Surgeon)','Left lobectomy, Thyroid','2022-08-08','2022-08-09','2022-08-11','Tissue measured 4.5x5x1 cm.','The histology section of Hyperplastic thyroid follicles with cuboidal epithelium. The nuclei are round. Colloid is decreased in some area and some area showed peripheral scalloping. Variable patchy lymphoid infiltrate in the stroma are noted. Some area showed nuclear clearing, nuclear enlargement.','Consistent with Controlled Toxic Goiter (? Graves disease)','0','0',8,6,2,'2022-08-11 22:59:09','2022-08-12 02:47:06'),(17,'Daw Tin Tin Moe','daw-tin-tin-moe',0,0,46,'Female','Professor Dr. U Aung Moe','Gall bladder','2022-08-10','2022-08-10','2022-08-11','Already opened gall bladder measured 5.5x3x0.5 cm. Multiple small black stones present.','The sections of the gallbladder show mucosa lining epithelium with focal attenuation into the wall. Rokitansky-Aschoff sinuses are also noted. Chronic inflammatory cells such as lymphocytes and plasma cells infiltration are also noted. Other than that there are no features of dysplasia and malignancy.','Chronic Calculus Cholecystitis','0','0',12,3,2,'2022-08-12 03:01:58','2022-08-12 03:01:58'),(13,'Ma Khaing Mar Oo','ma-khaing-mar-oo',0,0,32,'Female','Dr. Khin Ei Khaing (Senior Consultant ENT Surgeon)','Left lobectomy, Thyroid','2022-08-08','2022-08-09','2022-08-11','Tissue measured 4x2.5x1 cm. Encapsulated follicle is noted.','The sections of thyroid show an encapsulated tumor composed of small follicles with variable colloid. These follicles are lined by regular low cuboidal cells. There is no capsular and vascular invasion.   There are no features of malignancy.','Follicular adenoma, Left lobe of thyroid','0','0',8,6,2,'2022-08-11 22:44:18','2022-08-11 22:44:18'),(16,'Sein Moh Moh Aung','sein-moh-moh-aung',0,0,32,'Female','Professor Dr. U Aung Moe','Left axilla lump','2022-08-10','2022-08-10','2022-08-11','Tissue measured 9x5x2 cm.','The histology section of tissue showed fibrofatty tissue in which mammary glands and ducts. There are some cystic area lined by flattened to cuboidal epithelium are noted.','Consistent with fibrocystic disease of the breast, Left axilla','0','0',11,3,2,'2022-08-12 02:57:33','2022-08-12 02:57:33'),(15,'Daw Aye','daw-aye',0,0,46,'Female','Dr. KSDW','TAH and BSO','2022-08-08','2022-08-09','2022-08-11','TAH and BSO specimen measured 10x9x4 cm, already opened, two myoma present each measured 1x1 cm. Left ovary measured 2x2.5 cm and right ovary showed 1x1.5 cm.','The histology section of uterus showed mild endometrial hyperplasia. The myoma showed bundles of smooth muscles. The section of the cervix showed stratified squamous epithelium and endocervical epithelium with chronic cervicitis. The ovary showed corpus albicans.','1. Simple endometrial hyperplasia and leiomyoma, uterus\r\n2. Chronic cervicitis','0','0',10,6,2,'2022-08-12 02:42:31','2022-08-12 02:42:31'),(18,'Ma Phyu Hnin Wai','ma-phyu-hnin-wai',0,0,31,'Female','Professor Dr. U Aung Moe','Thyroid right lobe','2022-08-10','2022-08-10','2022-08-11','Thyroid tissue measured 7x4x2 cm. Encapsulated thyroid follicles present.','The sections of thyroid show an encapsulated tumor composed of small follicles with variable colloid. These follicles are lined by regular low cuboidal cells.  There is no capsular and vascular invasion. There are no features of malignancy.','Follicular adenoma, Right lobe of thyroid','0','0',8,3,2,'2022-08-12 03:05:52','2022-08-12 03:05:52'),(19,'Ko Myint San','ko-myint-san',0,0,24,'Male','Dr.','Appendix','2022-08-10','2022-08-10','2022-08-12','Appendix measured 4.5x1x0.2 cm.','The histology section of tissue composed of mucosa, submucosa, muscularis mucosa and serosa. There are infiltration of neutrophils across the muscle layer up to serosa.','Acute appendicitis with overlying peritonitis','0','0',13,6,2,'2022-08-12 09:15:52','2022-08-12 09:15:52'),(20,'U Win Thaung','u-win-thaung',0,0,48,'Male','