rowth.','The sections of the gallbladder show mucosa lining epithelium with focal attenuation into the wall. Rokitansky-Aschoff sinuses are also noted. Chronic inflammatory cells such as lymphocytes and plasma cells infiltration are also noted. Sheets of foamy histiocytes under the mucosa lining epithelium are also noted. Other than that there are no features of dysplasia and malignancy.','Chronic Cholecystitis','0','0',12,7,2,'2022-08-12 09:34:07','2022-08-12 09:34:07'),(25,'Daw Net','daw-net',0,0,76,'Female','Dr.KMK*','Hydatid cyst, liver','2022-08-09','2022-08-10','2022-08-12','Four pieces of tissues largest 3x3.5x2 cm.','The histology section of tissue composed of the cyst wall fluid with pinkish material s. In wall, there are some structures look like Echinococcus granulosus are seen.','Consistent with Hydatid cyst of liver','0','0',7,7,2,'2022-08-12 09:39:09','2022-08-12 09:39:09'),(26,'U Tun Maung','u-tun-maung',0,0,57,'Male','Professor Dr. U Aung Moe','FIA','2022-08-11','2022-08-12','2022-08-13','One piece of tissue measured 4x1x0.5 cm.','The histology section of tissue composed of acanthotic stratified squamous epithelium with underlying fibro-muscular tissue. Chronic inflammatory cells infiltration are also noted.','Chronic non-specific inflammatory tissue, Consistent with FIA','0','0',7,4,2,'2022-08-13 22:11:21','2022-08-13 22:11:21'),(27,'Khant Zayar Tun','khant-zayar-tun',0,0,21,'Male','Professor Dr. U Aung Moe','FIA','2022-08-11','2022-08-12','2022-08-13','One piece of tissue measured 5x2x1 cm.','The histology section of tissue composed of stratified squamous epithelium with underlying fibromuscular tissue with area of hemorrhages. Some sheets of histiocytes and histiocytic giant cells are noted.  Features of tuberculosis and malignancy are not seen.','Chronic non-specific inflammatory tissue, Consistent with FIA','0','0',7,3,2,'2022-08-13 22:15:17','2022-08-13 22:15:17'),(28,'Ko Ba Shwe','ko-ba-shwe',0,0,37,'Male','Professor Dr. U Aung Moe','Neck gland','2022-08-11','2022-08-12','2022-08-13','Multiple pieces of tissue about 5 CC. AE','The histology section of tissue composed of necrotic tissue with chronic inflammatory tissue especially lymhocytes with poor formed granuloma. The granuloma are composed of foamy histiocytes with Langerhans types of giant cells.','Chronic granulomatous inflammatory tissue consistent with tuberculous lymphadenitis, Neck gland','0','0',6,3,2,'2022-08-13 22:20:48','2022-08-13 22:20:48'),(29,'Daw Tin May Aye','daw-tin-may-aye',0,0,76,'Female','Professor Dr. U Aung Moe','Right breast lump','2022-08-11','2022-08-12','2022-08-13','One piece of tissue measured 2x2x0.5 cm.','The histology section of tissue composed of fibrofatty tissue with mammary glands and ducts. Some area showed cystic area lined by flattened to cuboidal epithelium. Malignant cells are not seen.','Fibrocystic disease of the breast, Right','0','0',6,3,2,'2022-08-13 22:23:34','2022-08-13 22:23:34'),(30,'Zin Min Maung Maung','zin-min-maung-maung',0,0,17,'Male','Professor Dr. U Aung Moe','Appendix','2022-08-11','2022-08-12','2022-08-13','Appendix measured 4x1x0.2 cm.','The histology section of tissue composed of mucosa, submucosa, muscularis mucosae and serous. There are mucosa ulceration with neutrophil infiltration across the wall of the serous. Some focal collection of pus cells are noted.','Consistent with suppurative appendicitis','0','0',13,3,2,'2022-08-13 22:26:17','2022-08-13 22:26:17'),(31,'Ma Zar Zar Lwin','ma-zar-zar-lwin',0,0,39,'Female','Dr.',NULL,'2022-08-11','2022-08-12','2022-08-13','1. Uterus and cervix measured 10x7x2 cm, ovarian cyst present. Myoma measured 5x3x1 cm. \r\n2. Posterior lip of cervix measured 3x2x0.5 cm.\r\n3. Cyst from fallopian measured 1x1.5 cm.','1. The endometrial tissue showed proliferative stages of endometrial glands and stroma. ovarian cyst wall showed corpus luteal cyst. \r\n2. The histology section of the cervix showed endocervical epithelium and endocervical glands. There are chronic inflammatory cells infiltration. Focal area of CIN II lesion are noted.  \r\n3. The cyst wall from fallopian tube showed fibrous wall with flattened epithelium.','1. Proliferative endometrium and corpus luteal cyst, leiomyoma\r\n2. CIN - II with chronic cervicitis \r\n3. Benign cyst of the fallopian tube','0','0',10,8,2,'2022-08-13 22:33:16','2022-08-16 17:03:03'),(32,'Ma Thet Thet Oo','ma-thet-thet-oo',0,0,25,'Female','Professor Dr. U Aung Moe','slides and tissue containing paraffin blocks','2022-08-12','2022-08-12','2022-08-14','Six slides and tissue containing paraffin block','Slide 1. Fibrofatty and lymphocytes infiltration.\r\nSlide 2. fibrofatty and some muscle bundles with some area of hemorrhages\r\nSlide 3. Fibrofatty tissue with lymphoid aggregates with giant cells and atrophic mammary lobules and ducts.\r\nSlide 4. Fibrofatty tissue with numerous giant cells and chronic inflammatory cells in filtration.\r\nSlide 5. Fibrofatty tissue with chronic inflammatory cells and numerous giant cells.\r\nSlide 6. Stratified squamous epithelium with underlying fibrous tissue in which chronic inflammatory cells infiltration and giant cells are noted. \r\nAll slides do not contain neoplastic malignant cells.','Consistent with Granulomatous lobular mastitis (GLM), Breast, Left','0','0',16,8,2,'2022-08-14 19:17:45','2022-08-14 19:17:45'),(33,'Daw Nyo San','daw-nyo-san',0,0,43,'Female','Professor Dr. U Aung Moe','Abscess, Right psoas region','2022-08-10','2022-08-11','2022-08-15','Three pieces of tissues largest 3.5x2x0.5 cm','The histology section of tissues composed of fibrofatty tissue with numerous pus cells. Tubercles are not seen.','Consistent with abscess, Right psoas region','0','0',7,3,2,'2022-08-15 23:08:11','2022-08-15 23:08:11'),(34,'Daw Cho Win','daw-cho-win',0,0,64,'Female','Professor Dr. U Aung Moe','Gall bladder','2022-08-13','2022-08-14','2022-08-15','Five pieces of tissues largest measured 3x2.5x1.5 cm, cut section showed some yellow tiny stones present.','The histology section of tissue composed of mucosa lining epithelium with underlying fibrous tissue with Aschoff sinus. Acute and chronic inflammatory cells infiltration are noted.','Chronic calculus cholecystitis','0','0',12,3,2,'2022-08-16 01:42:12','2022-08-16 01:42:12'),(35,'Daw May Thu San','daw-may-thu-san',0,0,44,'Female','Professor Dr. U Aung Moe','Left breast lump','2022-08-13','2022-08-14','2022-08-15','Tissue measured 4x3.5x1 cm.','The histology section of tissue composed of breast tissue with cyst lined by cuboidal to flatten epithelium. Malignant cells are not seen.','Fibrocystic disease of the breast, Left breast','0','0',7,3,2,'2022-08-16 01:44:45','2022-08-16 01:44:45'),(36,'Ma Nyein Nyein Ei','ma-nyein-nyein-ei',0,0,37,'Female','Professor Dr. U Aung Moe','Breast tissue, Right','2022-08-13','2022-08-14','2022-08-15','Tissue measured 3.5x3x1 cm.','The histology section of breast tissue composed of fibrous tissue with mammary glands and ducts. There are some cystic structures lined by cuboidal epithelium with some secretions are noted. malignant cells are not seen.','Consistent with fibrocystic disease of the breast, Right','0','0',7,3,2,'2022-08-16 01:46:08','2022-08-16 15:37:31'),(37,'Daw San Tint','daw-san-tint',0,0,46,'Female','Professor Dr. U Aung Moe','Breast lump, Right','2022-08-13','2022-08-14','2022-08-15','Breast tissue measured 9x6x4 cm, large cyst present measured 1.5x1 cm, multiple small cysts present.','The histology section of tissue composed of breast tissue with multiple cysts lined by cuboidal to flattened epithelium. There is no flat atypia. Malignant cells are not seen.','Fibrocystic disease of the breast, Right','0','0',11,3,2,'2022-08-16 01:49:44','2022-08-16 01:49:44'),(38,'Ar Thar Sae','ar-thar-sae',0,0,27,'Female','Dr. Zin Mar Latt','RPOC','2022-08-13','2022-08-14','2022-08-15','Multiple pieces of tissues about 10 CC.','The histology section of tissue composed of decidual cells with hyalinized villi. Area of hemorrhages are noted.','Retained Pieces of Conception','0','0',6,1,2,'2022-08-16 01:51:50','2022-08-16 01:51:50'),(39,'U Htwar','u-htwar',0,0,79,'Male','Professor Dr. U Aung Moe','Ca head of pancreas metastasis to liver','2022-08-13','2022-08-14','2022-08-15','One piece of tissue 1.5x1.5 cm, AE','The histology sections of tissue composed of the tumor tissue with extensive area of desmoplastic stroma. The gland formation is 50% to 95% of tumor composed of tumor area.','Consistent with  Moderately Differentiated Pancreatic Carcinoma, Ductal adenocarcinoma, Secondary metastasis to the liver','0','0',6,2,2,'2022-08-16 01:58:07','2022-08-16 01:58:07'),(40,'Daw Hera','daw-hera',0,0,59,'Female','Professor Dr. U Aung Moe','Breast tissue, left','2022-08-14','2022-08-16','2022-08-18','Tissue measured 6x7x2 cm with cyst present','Sections of breast lump show mammary tissue composed of hyperplasia of mammary lobules, ducts and glands embedded in the dense fibrofatty stroma. These mammary lobules are composed of dutules and acini.  They are lined by a single layer of regular low cuboidal cells with intact myoepithelial layer. Some foci of cystic spaces lined by a single layer of epithelial cells are noted. In some area, there are focal areas of atypical ductal hyperplasia in which epithelial cells almost completely fill the ducts. There is no evidence of malignancy.','Fibrocystic disease, breast, atypical ductal hyperplasia, breast, Left \r\n** Kindly recommended to do IHC markersCK5/6 and ER.','0','0',11,3,2,'2022-08-18 10:31:39','2022-08-18 10:31:39'),(41,'U Hla Thaung','u-hla-thaung',0,0,68,'Male','Professor Dr. U Aung Moe','Gall bladder','2022-08-15','2022-08-16','2022-08-18','Already opened gall bladder measured 10x4x2 cm, no growth and stone. Wall thickened and pus present.','The sections of the tissue showed mucosa lining epithelium, some glands and fibromuscular tissue. Area of hemorrhages and necrosis are also noted. Inflammatory cells infiltration are also noted. Sheets of histi