 are composed of dutules and acini.  They are lined by a single layer of regular low cuboidal cells with intact myoepithelial layer. Chronic inflammatory cell infiltrates are also noted. The sections of the skin and nippledo not reveal Paget’s cells. There are no residual malignant cells in tumor bed. Margins are free from tumor cells. Sections of lymph node show features of reactive follicular hyperplasia. There are no features of malignancy.','No residual malignant cells in tumor bed, breast, left','0','0',18,3,2,'2022-11-02 13:59:41','2022-11-04 19:13:52'),(413,'Daw Kyi Aye','daw-kyi-aye',0,0,63,'Female','Professor Dr Aung Moe','Right breast','2022-11-02','2022-11-03','2022-11-04','Right breast with lymph node 28x18x9 cm. Skin 17x10 cm and lymph node 4x2.5x2.5 cm.','The sections of the breast lump show an ill-circumscribed tumor composed of moderate stromal cellularity with prominent leaf-like architecture in some area with stromal condensation around the ducts. In some area, infiltration margins are also noted. Stroma overgrowth is also noted. Sarcomatous stroma and high mitotic count are not seen. Margins are free from the lesion. The axillary tissue showed only fibrofatty tissue.','Consistent with Borderline phylloides tumor, right breast','0','0',18,3,2,'2022-11-02 19:40:27','2022-11-05 16:03:37'),(414,'Daw Khaw Zat','daw-khaw-zat',0,0,56,'Female','Professor Dr Aung Moe','Right axillary node','2022-11-02','2022-11-03','2022-11-08','Multiple pieces of right axillary lymph node tissue largest 4x3x2 cm.','The histology section of tissue composed of fibrofatty tissue with some mammary ducts with lymph nodes with reactive follicular hyperplasia with sinus histiocytosis. Malignant cells and tubercles are not seen.','Reactive follicular hyperplasia and sinus histiocytosis, Right axillary node','0','0',6,3,2,'2022-11-02 19:43:00','2022-11-08 17:37:28'),(415,'Soe Pyae Theint','soe-pyae-theint',0,0,0,'Female','Professor. Dr. Yi Yi Kyaw',NULL,'2022-11-27',NULL,NULL,NULL