7, CK20, EMA, Synaptophysin, and CD56)','0','0',7,3,2,'2022-12-06 18:31:19','2022-12-06 18:33:07'),(568,'Daw Hla Myint','daw-hla-myint',0,0,55,'Female','Professor Dr Aung Moe','Retroperitoneum tumor','2022-12-05','2022-12-06','2022-12-07','Tissue from retroperitoneum tumor, duodenum-jejunum plexus and left para-aortic area 8x8x5 cm. Firm in consistency, white and some area of calcification are noted.','The histology section of tissue composed of lymphoid tissue with prominent vascular proliferation and hyalinization of the vessels wall. Artretic germinal centers traversed by sclerotic vessels and hyalinization are noted. Mantle zones are thickened with lymphocytes arranged in layers-onion skin appearance. Some vascular proliferation of endothelial venules with hyalinization are noted. Plasma cells, immunoblasts and eosinophils are seen. Unapparant sinuses and obliteration of subcapsuclar sinuses are also noted. Capsular thickenings are also noted. Margins are free from the lesions.','Consistent with Castleman disease, hyaline vascular variant, Lymph nodes, Retroperitoneal','0','0',25,3,2,'2022-12-06 19:01:43','2022-12-08 17:41:58'),(569,'Daw Moe Sandar Moe','daw-moe-sandar-moe',0,0,48,'Female','Professor Dr Aung Moe','Gall bladder','2022-12-06','2022-12-06','2022-12-07','Gall bladder tissue 5x3x1 cm, no growth and stone.','The sections of the gallbladder show infiltration of the mononuclear cells especially lymphocytes with some areas of fibrosis. The mucosa lining epithelium are seen. Rokitansky-Aschoff sinuses are also noted.  Other than that there are no features of dysplasia and malignancy.','Chronic Cholecystitis','0','0',12,3,3,'2022-12-06 19:02:38','2022-12-08 12:26:36'),(570,'Ma Shwe Poe Eain','ma-shwe-poe-eain',0,0,7,'Female','Dr Aung Si Hein','Lymph node','2022-12-06','2022-12-06','2022-12-07','Two small pieces of tissue from lymph node (AE).','The sections of the biopsy show lymphoid tissue composed of hyperplastic lymphoid follicles having prominent germinal centers and parafollical hyperplasia with few tingle bodies macrophages.  There are no epithelioid granulomas, abnormal lymphoid cells and malignant cells.','Reactive follicular hyperplasia with sinus histocytosis, lymph node, site not mention','0','0',6,6,3,'2022-12-06 19:05:18','2022-12-08 12:44:15'),(571,'U Win Soe','u-win-soe',0,0,52,'Male','Dr Ye Min Khant','Tissue from the below of the lip','2022-12-06','2022-12-06','2022-12-07','Tissue from the below of the lip 1x0.5x1 cm.','The histology section of tissue composed of stratified squamous epithelium with skin adnexal such as sebaceous glands and eccrine glands. There are nodular masses of basaloid cells that extend into the dermis in relation to a delicate, specialized tumor stroma. The are some some cystic area filled with tumor necrosis are noted. The tumor cells are polygonal to spindle with large, oval to elongated nuclei with little cytoplasm. The nuclei are hyperchromatic with some multiple nuclei. Peripheral palisading less prominent with prominent Retraction artifact. Some keratinization area are noted in the tumor area. Margins are not free from the lesions.','Consistent with Nodular variant of Basal cell carcinoma, below the lip','0','0',6,13,2,'2022-12-06 19:06:40','2022-12-08 17:21:51'),(572,'U Thein Chay','u-thein-chay',0,0,62,'Male','Dr Zayar Aung','intestine with head of pancreas, lymph node near the head of pancreas and ileum.','2022-12-06','2022-12-06','2022-12-07','(1) Tissue from intestine 7x1x1 cm and tumor measured 3x3x1 cm.\r\n(2) Lymph node near the head of pancreas (AE). No formalin. \r\n(3) Small lymph node 0.5x0.5x0.5 cm. No formalin.','1. The histology section of the tissue composed of intestinal mucosa lining epithelium and wall with attached tumor. The tumor cells are highly cellular and scant fibrous stroma. The cells are marked pleomorphic with variable amount of granular eosinophilic cytoplasm with variable nuclei with prominent nucleoi. The tumor tissues are invaded into the intestinal wall. Perineural and vascular invasion are not seen.  \r\n2 and 3. The lymph nodes showed reactive follicular hyperplasia and sinus histiocytosis','(1)  Consistent with Acinar cell carcinoma of the head of pancreas\r\n(2)  Reactive follicular hyperplasia with sinus histocytosis, lymph nodes','0','0',25,23,2,'2022-12-06 19:08:58','2022-12-08 17:01:14'),(573,'Daw Myat Su Win','daw-myat-su-win',0,0,46,'Female','Dr. Kyaw Khing Oo','Gall bladder','2022-12-05','2022-12-05','2022-12-06','Already opened gall bladder 8x1.7x1.5 cm. No growth and stone. Wall is 0.5 cm thickness.','The sections of the gallbladder show mucosa lining epithelium with dense infiltration of the mononuclear cells and few neutrophils in the wall with some areas of fibrosis. Areas of haemorrhage are noted. Other than that there are no features of dysplasia and malignancy.','Acute on Chronic Cholecystitis','0','0',12,7,2,'2022-12-07 01:37:26','2022-12-07 13:08:49'),(574,'Daw Myat Su Win','daw-myat-su-win',0,0,46,'Female','AP. Dr. MLT','TAH and BSO','2022-12-05','2022-12-05','2022-12-06','Already open uterus 6.5x7x6.5 cm, cervix 4.2x2.5x3.5 cm, right ovary 2x1.7x0.8 cm, left ovary with small cystic lesions 2.5x1.8x1.2 cm, one intramural myoma 5x4.5 cm and normal tubes.','(1)  The sections of uterus show proliferative-phase endometrium and myometrium. There are no features of hyperplasia and malignancy.\r\n(2)  The histology sections of myomas are composed of whorled pattern of smooth muscle bundles. The smooth muscles cells have elongated with eosinophilic cytoplasm and distinct cell membranes. There is no evidence of malignancy. Mitoses are not seen.\r\n(3)  Sections of the cervical biopsy show pieces of endocervical tissue composed endocervical glands and stratified squamous epithelium with stroma with moderate amount of inflammatory cells such as lymphocytes.  Endocervical glands and Nabothian cyst is also noted. Other than that there are no features of CIN Lesion and malignancy. \r\n(4)  The sections of ovary from Left show a thin –walled cyst lined by outer layer of follicular cells surrounded by reticulum fibers and hemorrhage. Other than that there are no features of malignancy.','(1)  Proliferative phase endometrium \r\n(2)  Leiomyoma, intramural \r\n(3)  Chronic cervicitis \r\n(4)  Follicular cyst, left ovary','0','0',10,7,2,'2022-12-07 01:45:20','2022-12-07 13:07:48'),(575,'Ko Htet Nay Oo','ko-htet-nay-oo',0,0,30,'Male','Dr. SLM','left flank','2022-12-05','2022-12-05','2022-12-06','Tissue from left flank 5x5x1.2 cm','The sections of tissues showed composed of regular adipose tissue cells with intervening fibrous septa. Some dilated blood vessels are also noted. There is no evidence of malignancy.','Lipioma, left flank','0','0',7,7,2,'2022-12-07 02:04:43','2022-12-07 13:10:17'),(576,'U Myint Hlaing','u-myint-hlaing',0,0,44,'Male','Professor Dr Aung Moe','Right BM,','2022-12-07','2022-12-08','2022-12-09','Two pieces of tissue from the ulcerated lesion at the right BM, largest 0.7x0.5x0.3 cm (AE).','The sections of the piece of tissue show stratified squamous epithelium invasive nests and groups of well-differentiated malignant squamous epithelial cells with hyperchromatic to vesicular nuclei, prominent nucleoli and scanty cytoplasm with few mitoses. The tumor cells are invaded into the underlying muscle. The stroma is infiltrated by acute and chronic inflammatory cells. The resection margins are free of tumor cells except the base of the lesion. Lymphovascular invasion are also noted.','Well-differentiated squamous cell carcinoma,right BM','0','1',6,8,3,'2022-12-07 21:18:45','2022-12-09 23:32:03'),(577,'Daw Khin Mar Tint','daw-khin-mar-tint',0,0,52,'Female','SCS Dr. Aung Htay','Right breast lump','2022-12-06','2022-12-06','2022-12-07','Right breast lump 9x8x5 cm.','The sections of the breast lump show tumor composed of stromal overgrowth with no epithelium in some area and prominent leaf-like architecture in some area with stromal condensation