inflammatory cells such as lymphocytes, neutrophils and eosinophils across the wall of the appendix. Areas of hemorrhage and necrosis are noted. Other than that there are no features of tubercle, sulphur granules and malignancy.','Suppurative appendicitis','0','0',13,3,3,'2023-01-08 14:58:43','2023-01-10 02:53:08'),(741,'U Myot Oo','u-myot-oo',0,0,36,'Male','Professor Dr Aung Moe','Pancreatic body, mesocolic lymph node and liver nodule','2023-01-08','2023-01-08','2023-01-09','1. Three pieces of small tissues from pancreatic body (AE).\r\n2. Mesocolic lymph node tissue o.7x0.5x0.3 cm \r\n3. Tissue from liver nodule 0.8x0.5x0.3 cm','1. The sections of the pancreatic tissue are composed of neoplastic cells arranged in acinar patterns with desmoplastic fibrous stroma. The neoplastic cells are monotonous cells with abundant eosinophilic granular cytoplasm, uniform nuclei and single prominent nucleoli.  Chronic inflammatory cells infiltration are also noted. \r\n2. The histology section of lymph nodes showed sinus histiocytosis. Fibrofatty tissue also noted. \r\n3. The liver nodes showed normal liver parenchmya tissue. Malignant cells are not seen.','Consistent with Acinar cell carcinoma, body of the pancreas','0','0',6,3,2,'2023-01-09 17:15:24','2023-01-13 01:58:28'),(742,'Ma Khin Hnaung Hnaung Cho','ma-khin-hnaung-hnaung-cho',0,0,19,'Female','Dr Myat Kay Thwe','Left breast lump','2023-01-09','2023-01-09','2023-01-10','Tissue from left breast lump 1.5x1x1 cm.','The sections of the breast lump show an encapsulated tumor composed of proliferating glands and ducts embedded in loose, fibrous stroma. The glands are both intra- and pericanilicular in type. They are lined by regular low cuboidal cells with intact myoepithelial layer. Epithelial hyperplasia with some duct papilloma are also noted. There are no features of malignancy.','Juvenile fibroadenoma, breast, left','0','0',6,9,2,'2023-01-09 17:17:50','2023-01-11 11:06:26'),(743,'Ma Khin Soe','ma-khin-soe',0,0,35,'Female','Dr HPW','Endometrial tissue','2023-01-09','2023-01-09','2023-01-10','Small pieces of endometrial tissue (AE).','The histology section of the tissue composed of the proliferative endometrium with some variation of the secretory changes with stromal hemorrhage. There are glandular-stromal disparity (individual glands are not at the same level of development as the stroma). Some endometrial glands with intraglandular papillary epithelial tufts are noted. Other than that there are no features of malignancy.','Glandular-stromal disparity with Arias-Stella reaction','0','0',6,6,3,'2023-01-09 17:19:08','2023-01-11 11:06:58'),(744,'Daw Soe Soe','daw-soe-soe',0,0,57,'Female','Professor Dr Aung Moe','Left buttock tissue','2023-01-09','2023-01-10','2023-01-11','Tissue from left buttock 5x4x2.5 cm.','The sections of biopsy contain fibrofatty tissue with several pus cells and inflammatory cells such as lymphocytes, plasma cells and eosinophils including some histiocytes. There is no evidence of tuberculosis and malignancy.','Non-specific abscess, buttock, left','0','0',7,3,2,'2023-01-09 17:19:55','2023-01-12 11:54:36'),(745,'Daw Khin San Win','daw-khin-san-win',0,0,55,'Female','Professor Dr Aung Moe','Left breast','2023-01-09','2023-01-10','2023-01-11','Left breast tissue 5.5x5x5 cm','The sections of the breast lump show proliferating glands and ducts embedded in cellular, loose, myxoid fibrous stroma. The glands are predominantly intracanilicular in type. They are arranged in clefts and irregular spaces and lined by regular low cuboidal cells with intact myoepithelial layer. Some minimal stromal cellularity in periductal region. There are no features of malignancy.','Consistent with benign phylloides tumor, breast, Left breast','0','0',11,4,3,'2023-01-09 18:36:55','2023-01-12 15:28:02'),(746,'U Moe Thu','u-moe-thu',0,0,40,'Male','Professor Dr Aung Moe','Stomach','2023-01-09','2023-01-10','2023-01-11','Small piece of tissue from stomach (AE).','Sections of the biopsy show pieces of gastric mucosa infiltrated by lymphocytes, plasma cells. The gastric glands, mucosa and pits are lined by regular tall columnar cells. A few long slender materials look like material Helicobacter pylori are also seen in almost all gastric pits (bacterial density score-4). There are no features of intestinal metaplasia, dysplasia and malignancy.','H. pylori-associated chronic gastritis, high bacterial density, stomach','0','0',6,4,3,'2023-01-09 18:37:27','2023-01-12 11:55:09'),(748,'U Kan Htay','u-kan-htay',0,0,61,'Male','Dr. Win Ko Ko','Bladder tumour (TURBT)','2023-01-09','2023-01-09','2023-01-10','Tissue from bladder tumour (TURBT) 0.5x0.5x0.2 cm (AE).','The histology section of tissue showed papillae with fused, branching and delicate, predominantly ordered with minimal crowding and minimal loss of polarity with cohesive. Nuclear size is enlarged with variation in size. Nuclear shape is round to oval nuclei with slight variation in shape and contour. Nuclear chromatin is mild variation within and between cells. Nucleoli in inconspicuous. Mitoses are not common. Umbrella cells are present. Muscles bundles are not present in the section. Foci of adenocarcinoma, squamous cells carcinoma and small cells carcinoma are not seen.','Consistent with noninvasive papillary urothelial carcinoma low grade, Urinary bladder','0','0',24,7,2,'2023-01-10 19:50:11','2023-01-11 11:20:00'),(749,'Ma Khin Thawdar Win','ma-khin-thawdar-win',0,0,34,'Female','Professor Dr Aung Moe','Gall bladder','2023-01-09','2023-01-10','2023-01-11','Gall bladder tissue 5x2x1.5 cm, no growth and stone.','The sections of the gallbladder show a dense infiltration of the mononuclear cells especially lymphocytes with some areas of fibrosis. The mucosa lining epithelium are seen. Rokitansky-Aschoff sinuses are also noted. Other than that there are no features of dysplasia and malignancy.','Chronic Cholecystitis','0','0',12,3,2,'2023-01-10 21:27:34','2023-01-12 02:45:57'),(750,'U Ku Mar','u-ku-mar',0,0,45,'Male','Professor Dr Aung Moe','Ischio-rectal sinus','2023-01-10','2023-01-10','2023-01-11','Tissue from ischio-rectal sinus 4x3x2 cm','The sections of the stratified squamous epithelium with underlying fibrofatty tissue in which eccrine glands. Chronic inflammatory cells infiltrated such as lymphocytes and plasma cells are also noted. In some area, there are numerous multinculeated giant cells are noted. Other than that, there are no features of malignancy.','Chronic granulomatous inflammatory tissues highly suspicious of tuberculosis ischio-rectal sinus','0','0',7,3,2,'2023-01-10 21:28:37','2023-01-12 02:36:55'),(751,'Ashin Eaindra Sar Ya','ashin-eaindra-sar-ya',0,0,45,'Male','Professor Dr Aung Moe','Right axillary lymph node','2023-01-10','2023-01-10','2023-01-11','Tissue from right axillary lymph node 7.5x7x3 cm. Cut section showed numerous abscess area filled with pus cells.','The sections of the stratified squamous epithelium with underlying fibrofatty tissue composed of areas of necrosis with some septate hyphae  look like fungal hyphae. Yeast cells are not seen. Chronic inflammatory cells infiltrated such as lymphocytes and plasma cells are also noted. Residual lymphoid follicles are noted. Other than that, there are no features of malignancy.','Highly suspicious of fungal infection, axillary lymph node, right','0','0',25,4,2,'2023-01-10 21:29:40','2023-01-12 15:25:51'),(752,'Daw Aye Myint','daw-aye-myint',0,0,64,'Female','Dr Aung Htay','Appendix','2023-01-10','2023-01-10','2023-01-11','Appendix tissue 3.5x1x0.5 cm','The sections of the appendix consist of wall of the appendix with obliteration of the lumen by fibro-fatty tissue. There is infiltration of a few acute and some chronic inflammatory cells including lymphocytes, plasma cells and eosinophils across the wall of the appendix. Congested blood vessels are also noted. Malignant cells and tubercles are not seen.','Acute on chronic appendicitis','0','0',13,24,2,'2023-01-10 21:30:36','2023-01-12 02:32:53'),(753,'Ma Thidar Aye','ma-thidar-aye',0,0,26,'Female','Dr Aung Htay','Supracalvicular lymph node, side not mention','2023-01-10','2023-01-10','2023-01-11','Three small pieces of suprecalvicular lymph node tissue, largest 1x0.5x0.5 cm (AE).','The sections of the lymph nodes are composed of areas of caseous necrosis with epithelioid granulomas. Few multinucleated giant cells, Langhans-type giant cells are also seen. Residual lymphoid follicles are noted. Other than that, there are no features of malignancy.','Consistent with tuberculous lymphadenitis, supracalvicular lymph node, Side not mention','0','0',6,24,2,'2023-01-10 21:31:21','2023-01-12 02:34:51'),(754,'Daw Nyo San','daw-nyo-san',0,0,68,'Female','Professor Dr Aung Moe','Swelling at parietal region','2023-01-10','2023-01-11','2023-01-12','Two pieces of tissues from the swelling at parietal region 1x1x0.5 cm and 1x0.5x0.5 cm','The sections of tissues composed of well circumscribed subcutaneous simple cyst, lined by stratified squamous epithelium that has a palisaded outer layer and contains dense laminated eosinophilic keratin, granular layer is absent. Few areas of calcification  are seen. Other than that there are no features of malignancy.','Trichilemmal (pilar) cyst, parietal region','0','0',6,4,3,'2023-01-10 21:32:19','2023-01-13 01:52:26'),(755,'Ma Phyu Hnin Phwe','ma-phyu-hnin-phwe',0,0,22,'Female','Dr Haymar Win','Appendix','2023-01-10','2023-01-11','2023-01-12','Appendix tissue 6x0.5x0.5 cm.','The sections of the appendix consist of the mucosa, submucosa, muscular layer and serosa with fecal material. Chronic Inflammatory cells infiltration such as lymphocytes and plasma cells are also noted. Other than that there are no features of tubercle and sulphur granules.','Chronic appendicitis','0','0',13,8,3,'2023-01-10 21:33:14','2023-01-13 01:52:42'),(756,'Ma Aye Aye Nyein','ma-aye-aye-nyein',0,0,17,'Female','Professor Dr Aung Moe','Gall bladder','2023-01-11','2023-01-11','2023-01-12','Gall bladder tissue 10x2x1.5 cm, no growth and stone.','The sections of the gallbladder show infiltration of the mononuclear cells especially lymphocytes with some areas of fibrosis. The mucosa lining epithelium are seen. Rokitansky-Aschoff sinuses are also noted. Other than that there are no features of dysplasia and malignancy.','Chronic Cholecystitis','0','0',12,3,3,'2023-01-11 17:14:22','2023-01-13 01:51:40'),(757,'Daw Nyunt Myaing','daw-nyunt-myaing',0,0,62,'Female','Prof; Dr. Tin Soe','Part of esophagus with part of stomach.\r\nLeft gastric lymph node and para-esophaheal lymph node.','2023-01-10','2023-01-10','2023-01-11','1. Tissue from part of esophagus 3x2.2x2 cm with part of stomach 6x3x2.5 cm.\r\nGrowth 2x1.6x1 cm, 1.7 cm from the upper margin and 2.5 cm from lower margin.\r\n2. Left gastric lymph node 1.2x0.5x0.4 cm (AE).\r\n3. Para-esophaheal lymph node 1x0.5x0.5 cm (AE).','1.The sections of the tumor reveal moderately differentiated squamous cell carcinoma with some area of keratin pearl and mitoses. The tumor cells penetrated into the adventitia. Lympho-vascular invasion are also noted. Margins are free from the lesion and infiltration of chronic inflammatory cells such as lymphocytes and plasma cells.\r\n2.Left gastric lymph node showed reactive follicular hyperplasia with sinus histiocytosis.\r\n3. Para-esophagus lymph node showed reactive follicular hyperplasia with sinus histiocytosis. Carbon laden macrophages are also noted.','Moderately differentiated squamous cells carcinoma, esophagus\r\npT3pN0','0','0',34,7,2,'2023-01-11 23:28:45','2023-01-12 02:05:14'),(758,'Ko Nyi Lin Thant','ko-nyi-lin-thant',0,0,23,'Male','Prof; Kyaw Khaing Oo','Appendix','2023-01-10','2023-01-10','2023-01-11','Appendix tissue 7x0.7 cm.','The sections of the appendix consist of the mucosa, submucosa, muscular layer and serosa with congested blood vessels. Areas of hemorrhage are also noted. Inflammatory cells infiltration such as lymphocytes, plasma cells and neutrophils are also noted. Other than that there are no features of tubercle and sulphur granules.','Acute Appendicitis','0','0',13,7,2,'2023-01-11 23:55:24','2023-01-12 02:06:26'),(759,'Daw Ei Thidar','daw-ei-thidar',0,0,46,'Female','Prof; Dr. Aung Moe','Swelling at right hypochondrium','2023-01-10','2023-01-10','2023-01-11','Tissue from the swelling at right hypochondrium region 3x1.5x1.5 cm.','The histology section of the given tissue composed of overlying stratified squamous epithelium with fibro-fatty tissue bearing a cystic lesion lined by regular stratified squamous epithelium having keratinous material. There is infiltration of chronic and acute inflammatory cells such as lymphocytes and plasma cells and few neutrophils. Other than that there are no features of malignancy.','Infected keratinous cyst, right hypochondrium','0','0',7,3,3,'2023-01-12 00:17:19','2023-01-12 02:06:52'),(760,'U Nay Myo Aung','u-nay-myo-aung',0,0,54,'Male','Professor Dr Aung Moe','Left undescended testis','2023-01-12','2023-01-13','2023-01-14','Left undescended testis tissue 8x3.5x4 cm.','The sections of biopsy show ill-circumscribed tumor composed of sheets of tumor with fibrous septae and discohesive population of large cells with moderate cytoplasm, round slightly irregular nuclei and one or more prominent nucleoli.   Mitoses and apoptotic bodies are seen. A few foci of hemorrhage are also noted. Some lymphocytic infiltration is noted. Some multinucleated giant cells look liked  syncytiotrophoblasts are also seen. Lymphovascular invasion is not seen in the sections examined.','Consistent with Seminoma with syncytiotrophoblastic cells, left undescended testis','0','0',21,4,2,'2023-01-12 21:19:56','2023-01-15 19:16:39'),(761,'Daw  Bin Due','daw-bin-due',0,0,68,'Female','Professor Dr Aung Moe','Liver wedge biopsy','2023-01-12','2023-01-13','2023-01-14','Liver wedge biopsy tissue 1x1.5x0.5 cm.','The sections of the tissue composed of nodular liver parenchyma cells infiltrated by well formed to cribriform glands and some anastomosing glands, with abundant fibrous stroma. The malignant glands are lined by cuboidal cells with variable degrees of atypia and pleomorphism. Most of the tumor cells are well differentiated adenocarcinoma with intracytoplasmic lumina. Perineural invasion are not seen.','Intrahepatic cholangiocarcinoma, small duct type','0','0',6,3,2,'2023-01-12 22:41:25','2023-01-15 19:17:55'),(762,'Daw Nyo','daw-nyo',0,0,75,'Female','Prof; Dr. Tun Tun Than','Lesion over the upper lip','2023-01-10','2023-01-11','2023-01-12','Tissue from lesion over the upper lip 1.7x1.4x1.1 cm, pigmented lesion 1.2x0.7x0.2 cm present. Grossly margins are free from the lesions.','The sections of the tissue are composed of stratified squamous epithelium with underlying fibrous tissue in which solid nest of basaloid cells with nuclear peripheral palisading in some clusters, with some mitoses are noted. Cleft-like retraction artifacts are also seen. Melanin pigments are also presentinside tumor lobules. Margins are free from the tumor cells.','Pigmented basal cell carcinoma, over the upper lip','0','0',6,7,2,'2023-01-13 00:14:01','2023-01-13 01:54:30'),(763,'U Aung Aung','u-aung-aung',0,0,37,'Male','Professor Dr Aung Moe','Submental lymph node','2023-01-13','2023-01-14','2023-01-16','Small lymph node measured 1.7x1.5x1 cm.','The histology section of tissue composed of lymph node with partial involvement by irregular shaped, pale areas composed of histiocytes, plasma cells, some plasmacytoid dendritic cells and immunoblasts.  Karyorrhectic debris are also noted. Other than that there are no features of malignancy and tubercles.','Subacute necrotizing lymphadenitis, Consistent with Kikuchi lymphadenitis, Submental lymph node','0','0',6,4,2,'2023-01-13 18:28:28','2023-01-16 18:11:55'),(764,'Daw Nue Si','daw-nue-si',0,0,57,'Female','Professor Dr Aung Moe','Gall bladder','2023-01-13','2023-01-14','2023-01-16','Gall bladder measured 8x2.5x0.5 cm.','The sections of the gallbladder show mucosa lining epithelium with chronic inflammatory cells infiltration. The mucosa is lined by regular low cuboidal cells with focal attenuation into the wall. There are focal area of glandular hyperplasia with some intestinal metaplasia in some gland. Features of dysplasia and malignancy are not seen.','Chronic Cholecystitis with adenomatous hyperplasia of the gall bladder','0','0',12,3,2,'2023-01-13 18:29:11','2023-01-16 18:12:06'),(765,'Daw Hnin Si','daw-hnin-si',0,0,38,'Female','CS Dr Khin Ei Khaing','Thyroid tissue','2023-01-13','2023-01-14','2023-01-16','Thyroid tissue measured 5x3x3 cm, cut sections showed encapsulated follicular lesion measured 2.7x2x3 cm, friable.','The section taken from the tissue shows thyroid tissue composed of thyroid follicles. In tumor area, encapsulated tumor tissue in which various sizes of thyroid follicles and papillary structures with some of which have ground glass nuclei, nuclear pseudoinclusions and very few have nuclear groove. Psammoma bodies are not seen in the section. Thick fibrous septa are also noted.','Consistent with Follicular Variant of Papillary Carcinoma, Thyroid, Left','0','0',8,6,2,'2023-01-13 18:29:44','2023-01-16 18:12:18'),(766,'Ma Yamin Thu','ma-yamin-thu',0,0,13,'Female','Professor Dr Aung Moe','(1)  Appendix tissue .\r\n(2)  Meckel\'s sinus','2023-01-14','2023-01-15','2023-01-16','(1)  Appendix tissue 5x0.7x0.7 cm.\r\n(2)  Tissue from meckel\'s sinus 2x5x0.5 cm.','(1)  The sections of the appendix consist of the mucosa, submucosa, muscular layer and serosa. There is infiltration of some chronic inflammatory cells including lymphocytes, plasma cells and few eosinophils across the wall of the appendix. Other than that there are no features of tubercle, sulphur granules and malignancy.\r\n(2)  The sections of the tissue consist of the fibromuscular wall with intestinal mucosa lining. Some mucosal glands are look liked intestinal lining mucosa wall. Mucosa ulceration is also noted. There is infiltration of few inflammatory cells such as lymphocytes and plasma cells. Other than that there are no features of tubercle, sulphur granules and malignancy.','(1)  Chronic appendicitis\r\n(2)  Compatible with Meckel\'s sinus','0','0',13,3,2,'2023-01-14 21:27:16','2023-01-17 01:25:23'),(767,'Daw Me Me Khnin','daw-me-me-khnin',0,0,44,'Female','Professor Dr Aung Moe',NULL,'2023-01-15',NULL,NULL,NULL,NULL,NULL,'2','1',29,4,2,'2023-01-15 17:13:07','2023-01-15 17:13:07'),(768,'Mg Thura Naing','mg-thura-naing',0,0,18,'Male','Professor Dr Aung Moe',NULL,'2023-01-15',NULL,NULL,NULL,NULL,NULL,'2','1',6,4,2,'2023-01-15 17:13:49','2023-01-15 17:13:49'),(769,'U Be Sa Nue','u-be-sa-nue',0,0,44,'Male','Professor Dr Aung Moe',NULL,'2023-01-15',NULL,NULL,NULL,NULL,NULL,'2','1',12,3,2,'2023-01-16 21:25:28','2023-01-16 21:25:28'),(770,'Daw Aye Thaw','daw-aye-thaw',0,0,58,'Female','Professor Dr Aung Moe',NULL,'2023-01-16',NULL,NULL,NULL,NULL,NULL,'2','1',12,4,2,'2023-01-16 21:26:02','2023-01-16 21:26:02'),(771,'Ashin Wai Pone La','ashin-wai-pone-la',0,0,41,'Male','Professor Dr Aung Moe',NULL,'2023-01-16',NULL,NULL,NULL,NULL,NULL,'2','1',6,4,2,'2023-01-16 21:26:46','2023-01-16 21:26:46'),(772,'Daw Me Me Khin','daw-me-me-khin',0,0,44,'Female','Professor Dr Aung Moe',NULL,'2023-01-16',NULL,NULL,NULL,NULL,NULL,'2','1',6,4,2,'2023-01-16 21:28:17','2023-01-16 21:28:17'),(773,'Daw Khin Thant Zin','daw-khin-thant-zin',0,0,35,'Female','Dr Zayar Aung',NULL,'2023-01-16',NULL,NULL,NULL,NULL,NULL,'2','1',6,23,2,'2023-01-16 21:29:26','2023-01-16 21:29:26'),(774,'Daw Than Than Aye','daw-than-than-aye',0,0,35,'Female','Dr Zayar Aung',NULL,'2023-01-16',NULL,NULL,NULL,NULL,NULL,'2','1',6,23,2,'2023-01-16 21:30:02','2023-01-16 21:30:02'),(775,'Daw Soe Soe','daw-soe-soe',0,0,55,'Female','Dr Zayar Aung',NULL,'2023-01-16',NULL,NULL,NULL,NULL,NULL,'2','1',6,23,2,'2023-01-16 21:30:47','2023-01-16 21:30:47'),(776,'Daw Ngwe Soe Kyi','daw-ngwe-soe-kyi',0,0,55,'Female','Dr Zayar Aung',NULL,'2023-01-16',NULL,NULL,NULL,NULL,NULL,'2','1',6